import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import RestaurantList from "./components/RestaurantsList";

function App() {
  return ( 
    <Router>
      <div>
        <Routes>
          <Route exact path="/" element={<RestaurantList />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
